if mibBuilder.loadTexts: saRgDeviceMode.setDescription('Defines the mode of operation for the device. This parameter is stored in non-vol and is multiSsid(1) by default. Setting this object via SNMP will cause the unit to reboot. This MIB will be superseded in the config file by TLV202. This MIB will read the proper value if set from TLV202. This MIB will be superseded by saRgIpMgmtLanMode inbridge(1) or mixed(4). disable(0): Value will reflect when TLV202 is set to 0. Not all platforms have this value implemented. multiSsid(1): Default Value. Value supports IPv4RG with multiple SSID configuration and bridge mode via saRgIpMgmtLanMode MIB. Bridge mode is the same as eRouter disabled mode. IPV4RG is the non eRouter behavior that existed before in our router products. Ipv4(3): eRouter IPv4 only mode Ipv6(4): eRouter IPv6 only mode Dualstack(5): eRouter IPv4 and IPv6 dualstack Note: cableHome11(2) support is not available.')
saRgDeviceResetDefaultEnable = MibScalar((1, 3, 6, 1, 4, 1, 1429, 79, 2, 1, 1, 2), TruthValue().clone('true')).setMaxAccess("readwrite")
if mibBuilder.loadTexts: saRgDeviceResetDefaultEnable.setStatus('current')
if mibBuilder.loadTexts: saRgDeviceResetDefaultEnable.setDescription('This object controls the reset to factory default functionality of the gateway. This prevents the local user from using the reset switch to gain access to the setup pages using the default user name and password. The objective is to prevent theft of service from a user who reconfigures the device to add users or change wireless settings. Enable (object set to true): 1. Momentary press of the Reset Switch (<5 seconds) DOCSIS restart of the modem (reboot, no reset to factory default values). 2. Pressing the reset switch for >5 seconds Reboots and resets of all values (modem and router) to factory default. Disable (object set to false): 1. Momentary press of the Reset Switch (<5 seconds) DOCSIS restart of the modem (reboot, no reset to factory default values). 2. Pressing the reset switch for >5 seconds Modem reboots and resets only the cable modem settings to factory default values. The router settings should remain and should not NOT reset to factory default.')
