if mibBuilder.loadTexts: saRgDeviceIpv6Trans.setDescription('This MIB will control which IPv6 transition technology is enabled on the device. After setting this MIB to disable in the config file, IPv4 traffic will pass normally through the device. When switched to dslite, the DSLite feature will be enabled. If eRouter is in IPv6-only mode, DS Lite will tunnel IPv4 traffic over IPv6 to the AFTR address specified either manually or in the DHCPv6 option-64. See saRgDslite MIB tree for more details. If this setting is changed by the config file, the CM will reboot. This MIB is written to non-vol and set to disable(0) after a factory reset. disable(0) - No technology is enabled enable(1) - DS lite feature is enabled')
saRgDeviceIpv6Passthrough = MibScalar((1, 3, 6, 1, 4, 1, 1429, 79, 2, 1, 1, 9), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1))).clone(namedValues=NamedValues(("disable", 0), ("enable", 1)))).setMaxAccess("readwrite")
