if mibBuilder.loadTexts: saRgDeviceIpv6Passthrough.setDescription('This MIB controls IPv6 passthrough on the RG and is applicable in bridge and router modes. When disabled the RG will function without any IPv6 passthrough When IPv6 passthrough is enabled in Bridge Mode the RG will drop all IPv4 traffic When IPv6 passthrough is enabled in router mode the RG will operate as normal for IPv4 traffic, but all IPv6 traffic will passthrough This MIB requires CM reboot. This MIB is written to non-vol and set to disable(0) after a factory reset.')
