if mibBuilder.loadTexts: saRgIpMgmtLanMode.setDescription('Defines the mode of operation for the device. Setting this object via SNMP for the primary BSS will cause the unit to reboot. Setting this object via SNMP for the secondary BSSs will not cause the unit to reboot. The value for primary BSS is stored in non-vol and is router after factory reset. The default value for other BSSs is router. This MIB supersedes saRgDeviceMode for the .32 interface. l2tpv2-client(3)is obsoleted and NOT supported. bridge(1): Sets individual interface to bridging mode (for IPv6 interfaces DHCPv6 is external) router(2): Sets individual interface to routing mode (for IPv6 interfaces DHCPv6 is internal) l2tpv2-client(3): <obsolete> mixed(4): For mixed mode. This setting is applicable only to .32 interface. This value is used on conjunction with saRgIpMgmtLanPortControlTable *Note: mixed(4) mode NOT Supported by DOCSIS 2.0 products. vlan (5): Enables the vlan control feature. See saRgVlanTable MIBs for VLAN configuration information.')
