if mibBuilder.loadTexts: saRgIpMgmtLanNetworksAllow.setDescription('Allows the user via the internal Web GUI (Lan Setup page to input an IPv4 public or private Local IP address other than a class C Private address (the default Network for the Primary BSS = 192.168.0.0/24, with the default Local Ip address = 192.168.0.1.) In all cases the mask must be 255.255.255.x since the RG is limited to supporting a maximum of 253 IP addresses. (See RFC1918 for a description of private IP addresses and specified ranges.) Available Mib settings: default(0): Only the third and fourth octets are editable in the Web GUI for the Local IP address (Ex. 192.168.x.x/24). anyPrivateClass(1): All 4 octets are editable in the Web GUI for Local IP address, but the network specified must be a Private class A, B or C network address. (Ex. A=10.x.x.x, B=172.16.x.x, C=192.168.x.x). anyClass(2): All 4 octets are editable in the Web GUI for Local IP address, and the network specified could be any public or private class A, B, or C address. If the MSO specifically sets a Local IP address in saRgIpMgmtLanNetwork to a value other than the default value (for example: 192.168.0.1) then these fields will be uneditable by the user (grayed out).')
